//// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.7.4;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts-upgradeable/proxy/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";

import "./interfaces/IClaimingRegistry.sol";
import "./interfaces/IPolicyRegistry.sol";
import "./interfaces/IPolicyBookRegistry.sol";
import "./interfaces/IContractsRegistry.sol";
import "./interfaces/IPolicyBookFabric.sol";
import "./interfaces/IBridgeDistributor.sol";
import "./interfaces/IPolicyBook.sol";
import "./interfaces/IPolicyBookFabric.sol";
import "./interfaces/IPolicyQuote.sol";
import "../../IDistributor.sol";


contract BridgeDistributor is IDistributor,
    Initializable,
    OwnableUpgradeable,
    ReentrancyGuardUpgradeable
{
    using SafeMath for uint256;

    IPolicyRegistry public policyRegistry;
    IPolicyBookRegistry public policyBookRegistry;
    IContractsRegistry public contractsRegistry;
    IClaimingRegistry public claimRegistry;
    IPolicyQuote public policyQuote;


    struct PolicyInfo {
        uint256 policiesCount;
        address[] polBooksArr;
        IPolicyRegistry.PolicyInfo[] policiesInfo;
        IClaimingRegistry.ClaimStatus[] status;
    }

    function initialize(
                address _contractsRegistry
        ) public initializer {
        __Ownable_init();
        __ReentrancyGuard_init();
        contractsRegistry    = IContractsRegistry(_contractsRegistry);
        policyRegistry       = IPolicyRegistry( contractsRegistry.getPolicyRegistryContract() );
        policyBookRegistry   = IPolicyBookRegistry( contractsRegistry.getPolicyBookRegistryContract() );
        claimRegistry        = IClaimingRegistry( contractsRegistry.getClaimingRegistryContract() );
        policyQuote          = IPolicyQuote( contractsRegistry.getPolicyQuoteContract() );
    }

    function getCoverCount(address _userAddr, bool _isActive)
        external view override
        returns (uint256){
        uint256 _ownersCoverCount = policyRegistry.getPoliciesLength(_userAddr);

        PolicyInfo memory pol;
           (pol.policiesCount,
            pol.polBooksArr,
            pol.policiesInfo,
            pol.status) = policyRegistry.getPoliciesInfo(_userAddr, _isActive, 0, _ownersCoverCount);
        return pol.policiesCount;
    }

    function getCover(address _userAddr, uint256 _coverId, bool _isActive, uint256 _limitLoop) external view override
         returns(IDistributor.Cover memory) {

           uint256 _ownersCoverCount = policyRegistry.getPoliciesLength(_userAddr);

            PolicyInfo memory pol;
           (pol.policiesCount,
            pol.polBooksArr,
            pol.policiesInfo,
            pol.status) = policyRegistry.getPoliciesInfo(_userAddr, _isActive, 0, _ownersCoverCount);

            require(_coverId < pol.policiesCount,"Invalid coverId");

            uint256 limit = 0;
                if(pol.policiesCount > _limitLoop){
                    limit = _limitLoop;
                }else{
                    limit = pol.policiesCount;
                }

            IDistributor.Cover[] memory userCovers = new IDistributor.Cover[](limit);

            for(uint coverId= 0; coverId < limit; coverId++){

                  IDistributor.Cover memory cover;
                  cover.contractAddress = pol.polBooksArr[coverId];
                  cover.coverAmount = pol.policiesInfo[coverId].coverAmount;
                  cover.premium = pol.policiesInfo[coverId].premium;
                  cover.productId = pol.policiesInfo[coverId].startTime;
                  cover.expiration = pol.policiesInfo[coverId].endTime;
                  cover.status = uint256(pol.status[coverId]);
                  userCovers[coverId] = cover;
            }
            return userCovers[_coverId];
    }

    function getPoliciesArr(address _userAddr)
        external
        view
        returns (address[] memory _arr){
        return policyRegistry.getPoliciesArr(_userAddr);
    }

    function getQuote(
        uint256 _bridgeEpochs,
        uint256 _amountInWei,
        address _interfaceCompliant3,
        address _bridgeProductAddress,
        address _interfaceCompliant4,
        bytes calldata _interfaceCompliant5
    ) external view override returns (
        IDistributor.CoverQuote memory
    ){

        bool isPolicyBook = policyBookRegistry.isPolicyBook(_bridgeProductAddress);
        require(isPolicyBook == true, "Not a policyBook present");

        IPolicyBook policyBook = IPolicyBook(_bridgeProductAddress);


        CoverQuote memory coverQuote;
       (coverQuote.prop1, // totalSeconds, totalPrice
        coverQuote.prop2) = policyBook.getPolicyPrice(_bridgeEpochs,_amountInWei);
        coverQuote.prop3  = policyBook.totalLiquidity();
        coverQuote.prop4  = policyBook.totalCoverTokens();
        //coverQuote.prop5  = policyQuote.getQuote(_durationSeconds,_tokens, _policyBookAddr); get price in DAI? 

        address[] memory policyBookArr = new address[](1);
        policyBookArr[0]  = address(policyBook);
        (IPolicyBookRegistry.PolicyBookStats[] memory _stats) = policyBookRegistry.stats(policyBookArr);
        coverQuote.prop6  = _stats[0].maxCapacity;

        return coverQuote;
    }


    function buyCover(
        address _bridgeProductAddress,
        address _interfaceCompliant1,
        uint256 _durationSeconds,
        uint16 _interfaceCompliant2,
        uint8 _interfaceCompliant3,
        uint256 _coverTokens,
        bytes calldata _interfaceCompliant4
        ) external 
        payable override nonReentrant{
            IPolicyBook policyBook = IPolicyBook(_bridgeProductAddress);
            policyBook.buyPolicy( _durationSeconds,  _coverTokens);
    }

    function buyCoverDecode(
        uint16[] memory products,
        uint16[] memory durationInDays,
        uint256[] memory amounts,
        address currency,
        uint256 premiumAmount,
        uint256[] memory helperParameters,
        uint256[] memory securityParameters,
        uint8[] memory v,
        bytes32[] memory r,
        bytes32[] memory s
    ) external payable override nonReentrant {
        revert("Unsupported operation");
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override returns (bool) {
         return interfaceId == type(IDistributor).interfaceId || supportsInterface(interfaceId);
    }

}
